/////////////////////////////////////////////////////////
//Cuenta de ahorro

//En un inicio el saldo es cero. 

//Ingresar saldo 
//Retirar saldo 

//Valide si es posible ingresar o retirar valor

//Guardar mis datos
// Address de cuenta - Nombre, edad, color favorito.
/////////////////////////////////////////////////////////


// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

contract Ejercicio1CuentaAhorro {
    int saldo;

    function ingresarSaldo (uint saldoParaIngresar) public {
        saldo += 1;
    }
}

